import * as React from "react";

const FormCustomer = (props) => {
  const navigate = props?.navigate;
  const { innerWidth: width } = window;


  const goHome = (x) => {
    navigate("/", { state: { languages: `${x}` } });
  };

  const goLogin = (x) => {
    navigate("/Login", { state: { languages: `${x}` } });
  };

  return (
    <>
      <div>
        <div
          style={{
            position: "fixed",
            top: 20,
            left: width * 0.59,
            textAlign: "-webkit-center",
            width: 500,
            background: " #FFFFFF",
            boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
            borderRadius: 20,
            padding: 30,
          }}
        >
          <div
            style={{
              fontWeight: 400,
              fontSize: 18,
              textDecorationLine: "none",
              textAlign: "left",
              marginBottom: 20,
              float: "left",
              background: "transparent",
              border: "none",
            }}
            onClick={() => goHome("English")}
          >
            <p id={"Hometext"}>{REGI01_box1EN[0].label}</p>
            <BsArrowLeftShort id={"Hometext2"} />
          </div>

          <button
            style={{
              fontWeight: 400,
              textAlign: "right",
              marginBottom: 20,
              float: "right",
              color: "#D9D9D9",
              background: "transparent",
              border: "none",
            }}
            onClick={() => goLogin("English")}
          >
            <p id={"Signuptext"}>{REGI01_box1EN[1].label}</p>
            <BsArrowRightShort id={"Signuptext2"} />
          </button>

          <h2 className="textSignup">{REGI01_box1EN[2].label}</h2>
          <div>
            <FormControl style={{ display: "inherit" }}>
              <RadioGroup
                row
                aria-labelledby="demo-row-radio-buttons-group-label"
                name="row-radio-buttons-group"
              >
                <FormControlLabel
                  checked={true}
                  onChange={handleChange}
                  name="radio-buttons"
                  value=""
                  control={<Radio />}
                  label={REGI01_box1EN[3].label}
                  style={{ marginRight: 50 }}
                />
                <FormControlLabel
                  onChange={handleChange}
                  name="radio-buttons"
                  value="For Translators"
                  control={<Radio />}
                  label={REGI01_box1EN[4].label}
                />
              </RadioGroup>
            </FormControl>
          </div>

          <div style={{ textAlign: "left", marginTop: 10 }}>
            <p
              style={{
                fontWeight: 500,
                fontSize: 15,
                color: "#242424",
              }}
            >
              {REGI01_box1EN[5].label}
            </p>
            <input
              type="text"
              value={firstname}
              onChange={(e) => setFirstname(e.target.value)}
              placeholder={REGI01_box1EN[5].label}
              style={{
                background: "#FFFFFF",
                border: "1px solid #F1F1F1 ",
                borderRadius: 20,
                width: "100%",
                height: 30,
                padding: 20,
                paddingLeft: 12,
                margin: 10,
                fontSize: 13,
              }}
            />
          </div>

          <div style={{ textAlign: "left" }}>
            <p
              style={{
                fontWeight: 500,
                fontSize: 15,
                color: "#242424",
              }}
            >
              {REGI01_box1EN[6].label}
            </p>
            <input
              type="text"
              name="user_email"
              // value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder={REGI01_box1EN[7].label}
              style={{
                background: "#FFFFFF",
                border: "1px solid #F1F1F1",
                borderRadius: 20,
                width: "100%",
                height: 30,
                padding: 20,
                paddingLeft: 12,
                margin: 10,
                fontSize: 13,
              }}
            />
          </div>

          <div style={{ textAlign: "left" }}>
            <p
              style={{
                fontWeight: 500,
                fontSize: 15,
                color: "#242424",
              }}
            >
              {REGI01_box1EN[8].label}
            </p>

            <input
              type={type}
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder={REGI01_box1EN[9].label}
              style={{
                background: "#FFFFFF",
                border: "1px solid #F1F1F1 ",
                borderRadius: 20,
                borderColor: "#F1F1F1",
                width: "100%",
                height: 30,
                padding: 20,
                paddingLeft: 12,
                margin: 10,
                fontSize: 13,
              }}
            />
            <IconButton
              onClick={() => handleClickShowPassword(1)}
              edge="end"
              style={{ position: "absolute", right: 40, top: 380 }}
            >
              {values ? <FiEye /> : <FiEyeOff />}
            </IconButton>
          </div>

          <div style={{ textAlign: "left" }}>
            <p
              style={{
                fontWeight: 500,
                fontSize: 15,
                color: "#242424",
              }}
            >
              {REGI01_box1EN[10].label}
            </p>

            <input
              type={type2}
              value={confirmpassword}
              onChange={(e) => setConfirmpassword(e.target.value)}
              placeholder={REGI01_box1EN[9].label}
              style={{
                background: "#FFFFFF",
                border: "1px solid #F1F1F1 ",
                borderRadius: 20,
                borderColor: "#F1F1F1",
                width: "100%",
                height: 30,
                padding: 20,
                paddingLeft: 12,
                margin: 10,
                fontSize: 13,
              }}
            />
            <IconButton
              onClick={() => handleClickShowPassword(2)}
              edge="end"
              style={{ position: "absolute", right: 40, top: 465 }}
            >
              {values2 ? <FiEye /> : <FiEyeOff />}
            </IconButton>
          </div>

          <div style={{ textAlign: "left", marginBottom: 10 }}>
            <p
              style={{
                fontWeight: 500,
                fontSize: 15,
                color: "#242424",
              }}
            >
              {REGI01_box1EN[11].label}
            </p>

            <input
              type="text"
              value={mobilephone}
              onChange={(e) => setMobilephone(e.target.value)}
              placeholder={REGI01_box1EN[11].label}
              style={{
                background: "#FFFFFF",
                border: "1px solid #F1F1F1 ",
                borderRadius: 20,
                borderColor: "#F1F1F1",
                width: "100%",
                height: 30,
                padding: 20,
                paddingLeft: 12,
                margin: 10,
                fontSize: 13,
              }}
            />
          </div>

          <button
            style={{
              width: "100%",
              borderRadius: 20,
              background: " #001E33",
              height: 40,
              color: "#FFFFFF",
              fontSize: 18,
              borderColor: "transparent",
            }}
            onClick={() => setScreen("3")}
          >
            {REGI01_box1EN[12].label}
          </button>
        </div>
      </div>
    </>
  );
};
export default FormCustomer;
